import React from "react";
import ArticlePreviewItem from "../article-preview-item/ArticlePreviewItem";

const articles = [
  { title: "Title 1", content: "Content 1", imgpreview: "/" },
  { title: "Title 2", content: "Content 2", imgpreview: "/" },
  { title: "Title 3", content: "Content 3", imgpreview: "/" },
  { title: "Title 4", content: "Content 4", imgpreview: "/" },
];

const ArticlePreviewContainer = () => {
  return (
    <div>
      {articles.map((item, index) => {
        return (
          <ArticlePreviewItem
            key={index}
            title={item.title}
            content={item.content}
            imgpreview={item.imgpreview}
          />
        );
      })}
      ;
    </div>
  );
};

export default ArticlePreviewContainer;
